import React from "react";
import { Col, Row } from "react-bootstrap";

export const LojaFlter = () => {
  return (
    <div className="bodie">
      <Row
        style={{ height: "100%", minHeight: "100vh", paddingTop: "20px" }}
        className="justify-content-center align-content-start"
      >
        <Col xs={11}></Col>
      </Row>
    </div>
  );
};
